  false,\n\t\"url\": null,\n\t\"notes\": \"These are polygon and raster data sets
  derived from 2002 Landsat Thematic Mapper Satellite Imagery that indicates areas
  of land and areas of water in Louisiana. The interface is for the entire state within
  a 10 mile buffer. There are 4 layers: a 3 acre filter layer, a 5 acre filter layer,
  a 25 acre filter layer, and a 1 acre filter raster layer.\",\n\t\"license_title\":
